export const getUsers = (page: number, limit: number) => {
    let array = []
    for (let i = (page - 1) * limit; i < (page * limit) && users[i]; i++) {
        array.push(users[i])
    }
    return array;
}

export const getLength = () => {
    return users.length;
}
